export const initialState = {
    id: 0,
    title: 'Lespo',
    typeVariant: 0,
    price: 3.43,
    inputs: {
        username: {
            value: ""
        },
    }
}

export function orderFormReducer(state = initialState, action) {
    switch (action.type) {
        case '':
            return {...state,}

        default:
            return state
    }
}
